Způsob jednání:
Jménem společnosti jedná představenstvo: a) společně dvěma členy představenstva, z nichž alespoň jeden je předsedou nebo místopředsedou představenstva, není-li dále stanoveno jinak. Pokud předseda ani místopředseda nejsou zvoleni, jednají společně alespoň
 tři členové představenstva;
b) samostatně předsedou nebo místopředsedou představenstva, a to v rozsahu tohoto  pověření;
c) společně všemi členy představenstva při zcizování kapitálových účastí, a to i jen jejich částí.

Způsob jednání:
Jménem společnosti jedná představenstvo: a) společně dvěma členy představenstva, z nichž alespoň jeden je předsedou nebo místopředsedou představenstva, není-li dále stanoveno jinak. Pokud předseda ani místopředseda nejsou zvoleni, jednají společně alespoň
 tři členové představenstva;
b) samostatně předsedou nebo místopředsedou představenstva na základě písemného pověření představenstva, a to v rozsahu tohoto  pověření;
c) společně všemi členy představenstva při zcizování kapitálových účastí, a to i jen jejich částí.
